import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Importe as páginas que você vai criar
import CreateComunicado from './pages/Create';
import FeedbackPage from './pages/Feedback'; // Você vai criar este arquivo depois
import AnalyticsPage from './pages/Analytics'; // Você vai criar este arquivo depois

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <header className="bg-white shadow p-4 mb-8">
          <nav className="container mx-auto flex justify-between items-center">
            <Link to="/create" className="text-xl font-bold text-gray-800">
              Sistema de Comunicados
            </Link>
            <div className="space-x-4">
              <Link to="/create" className="text-blue-500 hover:text-blue-700 font-semibold">
                Criar Comunicado
              </Link>
              <Link to="/analytics" className="text-blue-500 hover:text-blue-700 font-semibold">
                Análise
              </Link>
            </div>
          </nav>
        </header>

        <main className="container mx-auto p-4">
          <Routes>
            {/* Rota para a página de criação do comunicado */}
            <Route path="/create" element={<CreateComunicado />} />
            <Route path="/comunicado/:id" element={<ViewComunicado />} /> {/* A nova rota */}
            <Route path="/feedback/:tokenFeedback" element={<FeedbackPage />} />
            <Route path="/analytics" element={<AnalyticsPage />} />
            <Route path="/" element={<CreateComunicado />} />
            {/* Rota inicial que redireciona para a página de criação */}
            <Route path="/" element={<CreateComunicado />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
